import React from 'react'

export default function ProductCard(props) {
  return (
    <div className='justify-center items-center border-2 inline-block p-10'>
        <div className='inline-block'>
         <img src={props.logo.url} alt="" />

        </div>

        <p className='product-name'>Greyhound Hoodie {props.title}</p>
        <p className='product-price'>${props.price}</p>
    </div>
  )
}
